// src/App.js
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import SignupForm from "./components/SignupForm";
import SigninForm from "./components/SignIn";

function App() {
  return (
    <Router>
      <nav>
        <Link to="/signin">Sign In</Link>
        <Link to="/signup" style={{ marginLeft: 10 }}>
          Sign Up
        </Link>
      </nav>

      <Routes>
        <Route
          path="/signin"
          element={
            <SigninForm backendUrl={process.env.REACT_APP_BACKEND_URL} />
          }
        />
        <Route
          path="/signup"
          element={
            <SignupForm backendUrl={process.env.REACT_APP_BACKEND_URL} />
          }
        />
        {/* Add default or other routes here */}
      </Routes>
    </Router>
  );
}

export default App;
